gIB(){return'For security reasons and to protect the transmission of confidential content, such as the inquiries you send to us as the site operator, this site uses SSL encryption. You can recognize an encrypted connection by the fact that the address line of the browser changes from "http://" to "https://" and by the lock symbol in your browser line.\n\nIf SSL encryption is activated, the data that you transmit to us cannot be read by third parties.'},
